/*!50003 CREATE*/ /*!50017 DEFINER=`chicdb`@`%`*/ /*!50003 TRIGGER `retailer_orders_BEFORE_UPDATE` BEFORE UPDATE ON `retailer_orders` FOR EACH ROW BEGIN
-- If status is changing to 'Beading', update 'beading' timestamp
