CREATE DEFINER=`chicdb`@`%` PROCEDURE `PRC_getOrdersListByType`(IN orderType VARCHAR(20))
BEGIN
	IF orderType = 'ALL'
    THEN
		SELECT 
			o.*,
			bd.*,
			p.productCode,
			cat.name AS categoryName,
			subcat.name AS subCategoryName
		FROM
			orders AS o
				JOIN
			bodydetails AS bd ON o.id = bd.orderId
				JOIN
			orderitems AS oi ON oi.orderId = o.id
				JOIN
			products AS p ON oi.productId = p.id
				JOIN
			categories AS cat ON p.categoryId = cat.id
				JOIN
			subcategories AS subcat ON p.subCategoryId = subcat.id
		GROUP BY o.id
		ORDER BY o.id DESC;
ELSE
		SELECT 
			o.*,
			bd.*,
			p.productCode,
			cat.name AS categoryName,
			subcat.name AS subCategoryName
		FROM
			orders AS o
				JOIN
			bodydetails AS bd ON o.id = bd.orderId
				JOIN
			orderitems AS oi ON oi.orderId = o.id
				JOIN
			products AS p ON oi.productId = p.id
				JOIN
			categories AS cat ON p.categoryId = cat.id
				JOIN
			subcategories AS subcat ON p.subCategoryId = subcat.id
		WHERE o.orderType = orderType
		GROUP BY o.id
		ORDER BY o.id DESC;
END IF;
END ;;
