CREATE DEFINER=`chicdb`@`%` PROCEDURE `PRC_getRecentDashboardOrders`(IN numLimit INT, IN fromRows INT,IN orderStatus VARCHAR(15))
BEGIN
	IF orderStatus = 'ALL'
    THEN
		SELECT 
    p.productCode,
    o.status,
    DATE_FORMAT(o.estimatedDeliveryTime, '%d %M %Y') AS dueDate,
    pi.name AS image,
    CONCAT(p.price, ' ', 'x', oi.quantity) AS priceString
FROM
    orders AS o
        JOIN
    orderitems AS oi ON oi.orderId = o.id
        JOIN
    products AS p ON oi.productId = p.id
        JOIN
    productimages AS pi ON pi.productId = p.id
    ORDER BY o.createdAt DESC
    LIMIT numLimit OFFSET fromRows;
	ELSE
		SELECT 
    p.productCode,
    o.status,
    DATE_FORMAT(o.estimatedDeliveryTime, '%d %M %Y') AS dueDate,
    pi.name AS image,
    CONCAT(p.price, ' ', 'x', oi.quantity) AS priceString
FROM
    orders AS o
        JOIN
    orderitems AS oi ON oi.orderId = o.id
        JOIN
    products AS p ON oi.productId = p.id
        JOIN
    productimages AS pi ON pi.productId = p.id
    WHERE o.status = orderStatus
    ORDER BY o.createdAt DESC
    LIMIT numLimit OFFSET fromRows;
	END IF;
END ;;
