CREATE DEFINER=`chicdb`@`%` PROCEDURE `PRC_getSalesByCategoryWise`(IN subCategoryName VARCHAR(20), IN startDate VARCHAR(10) , IN endDate VARCHAR(10))
BEGIN
	IF subCategoryName = 'ALL'
    THEN
		SELECT 
			sc.name AS subCategoryName,
			SUM(o.totalAmount) AS totalAmount
		FROM
			orders AS o
			JOIN orderitems as oi on oi.orderId = o.id
			JOIN products as p on oi.productId = p.id
			JOIN subcategories as sc ON p.subCategoryId = sc.id
		WHERE
			o.createdAt BETWEEN CONCAT(startDate , ' 0:0:0')AND CONCAT(endDate , ' 23:59:59')
		GROUP BY sc.id;
	ELSE
		SELECT 
			sc.name AS subCategoryName,
			SUM(o.totalAmount) AS totalAmount
		FROM
			orders AS o
			JOIN orderitems as oi on oi.orderId = o.id
			JOIN products as p on oi.productId = p.id
			JOIN subcategories as sc ON p.subCategoryId = sc.id
		WHERE
			o.createdAt BETWEEN CONCAT(startDate , ' 0:0:0')AND CONCAT(endDate , ' 23:59:59')
            AND sc.name = subCategoryName
		GROUP BY sc.id;
	END IF;
END ;;
