CREATE DEFINER=`chicdb`@`%` PROCEDURE `PRC_getTopProductReport`(IN startDate VARCHAR(20), IN endDate VARCHAR(20))
BEGIN
SELECT 
    p.productCode,
    cat.name AS category,
    subCat.name AS subCategory,
    COUNT(oi.productId) AS orderCount
FROM
    orderitems oi
        JOIN
    orders o ON oi.orderId = o.id
        JOIN
    products p ON oi.productId = p.id
        JOIN
    categories cat ON p.categoryId = cat.id
        JOIN
    subCategories subCat ON p.subCategoryId = subCat.id
    WHERE o.createdAt BETWEEN CONCAT(startDate , ' 0:0:0')AND CONCAT(endDate , ' 23:59:59')
GROUP BY oi.productId
ORDER BY orderCount DESC;
END ;;
