CREATE DEFINER=`chicdb`@`%` PROCEDURE `PRC_getTotalSalesByRegion`(IN region VARCHAR(30))
BEGIN
IF region = 'ALL'
THEN
	WITH TotalSales AS (
		SELECT SUM(totalAmount) AS total_sales
		FROM orders
	)
	SELECT 
		customerAddress, 
		SUM(totalAmount) AS regionSales,
		CAST((SUM(totalAmount) * 100.0 / (SELECT total_sales FROM TotalSales)) as SIGNED) AS regionSalesPercentage
	FROM orders
	GROUP BY customerAddress
	ORDER BY regionSalesPercentage DESC;
ELSE
	WITH TotalSales AS (
		SELECT SUM(totalAmount) AS total_sales
		FROM orders
	)
	SELECT 
		customerAddress, 
		SUM(totalAmount) AS regionSales,
		CAST((SUM(totalAmount) * 100.0 / (SELECT total_sales FROM TotalSales)) as SIGNED) AS regionSalesPercentage
	FROM orders
    WHERE customerAddress = region
    GROUP BY customerAddress
	ORDER BY regionSalesPercentage DESC;
END IF;
END ;;
